ents and promotions should be made to optimise earnings while preparing for the strong demand during this season. Further investigation should be done to figure out why the products are not selling as well in other seasons and make appropriate decisions.\n","\n","* According to the chart \"Top 10 Countries That Brings The Highest Money\" for both 2018 and 2019 we can see that the United Kingdom is where we generate the majority of our sales. We can take advantage of this by expanding there and offering promotions that are only available there. Additional study should be conducted to determine why sales are low  in countries like Japan and, once we have that information, relevant solutions can be developed."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":15.079055,"end_time":"2022-11-22T16:14:30.125349","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-11-22T16:14:15.046294","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}